define('text!modules/home/components/uccInformation.html', ['module'], function(module) { module.exports = "<template>\n\t<div class=\"home-page-header underline\">UCC Session Information</div>\n\t<div class=\"col-lg-3\">\n\t\t<h3 class=\"underline\">Current Sessions</h3>\n\t\t<div class=\"list-group\">\n\t\t\t<a class=\"list-group-item\" repeat.for=\"session of sessions.sessionsArray | sessionType:'Active:Requests:Next'\">\n\t\t\t\t<h4 class=\"list-group-item-heading\">${session.sessionStatus}: Session ${session.session} - ${session.year}</h4>\n\t\t\t\t<p class=\"list-group-item-text\">Requests open: ${session.requestsOpenDate | dateFormat:config.DATE_FORMAT_TABLE}</p>\n\t\t\t\t<p class=\"list-group-item-text\">Clients available: ${session.startDate | dateFormat:config.DATE_FORMAT_TABLE}</p>\n\t\t\t\t<p class=\"list-group-item-text\">Session ends: ${session.endDate | dateFormat:config.DATE_FORMAT_TABLE}</p>\n\t\t\t</a>\n\t\t</div>\n\t</div>\n\t<div class=\"col-lg-4 col-lg-offset-1\">\n\t\t<h3 class=\"underline\">Sessions Schedule</h3>\n\t\t<div repeat.for=\"item of siteinfo.siteArray | infoFilter:'INFO'\">\n\t\t\t<h3>${item.title}</h3>\n\t\t\t<span innerhtml=\"${item.content}\"></span>\n\t\t</div>\n\t</div>\n\t<div class=\"col-lg-3\">\n\t\t<h3 class=\"underline\">UCC Sessions</h3>\n\t\t<span innerhtml.bind=\"config.SESSION_EXPLANATION\"></span>\n\t</div>\n\t\n</template>"; });
