define('text!modules/admin/customers/components/institutionsForm.html', ['module'], function(module) { module.exports = "<<template>\n    <div class=\"col-lg-12\">\n        <div class=\"bottomMargin list-group-item leftMargin rightMargin\">\n            <span click.delegate=\"back()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\"\n                data-original-title=\"Back\"><i class=\"fa fa-arrow-left fa-lg fa-border\" aria-hidden=\"true\"></i></span>\n            <span click.delegate=\"save()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\"\n                data-original-title=\"Save\"><i class=\"fa fa-floppy-o fa-lg fa-border\" aria-hidden=\"true\"></i></span>\n            <span click.delegate=\"cancel()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\"\n                title=\"\" data-original-title=\"Cancel Changes\"><i class=\"fa fa-ban fa-lg fa-border\" aria-hidden=\"true\"></i></span>\n            <span show.bind=\"!newInstitution\" click.delegate=\"delete()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\"\n                title=\"\" data-original-title=\"Delete\"><i class=\"fa fa-trash fa-lg fa-border text-danger\" aria-hidden=\"true\"></i></span>\n        </div>\n\n        <div class=\"topMargin\">\n            <form class=\"form-horizontal\">\n                <!-- Row 1 -->\n                <div class=\"row\">\n                    <div class=\"col-sm-12 col-lg-3\">\n                        <div class=\"form-group\">\n                            <div class=\"col-sm-10\">\n                                <label>Name *</label>\n                                <input value.bind=\"people.selectedInstitution.name\" id=\"editName\" class=\"form-control\" placeholder=\"Name\" type=\"text\" />\n                            </div>\n                        </div>\n                    </div>\n                    <div class=\"col-sm-12 col-lg-3\">\n                        <div class=\"form-group\">\n                            <div class=\"col-sm-10\">\n                                <label>Modifed Date</label>\n                                <date-picker value.two-way=\"people.selectedInstitution.dateModified\"  controlid=\"modifiedDate\"></date-picker>\n                            </div>\n                        </div>\n                    </div>\n                    <div class=\"col-sm-12 col-lg-3\">\n                        <div class=\"form-group\">\n                            <div class=\"col-sm-10\">\n                                <label>Date Joined</label>\n                                <date-picker value.two-way=\"people.selectedInstitution.joinDate\"  controlid=\"joinDate\"></date-picker>\n                            </div>\n                        </div>\n                    </div>\n                    <div class=\"col-sm-12 col-lg-3\">\n                        <div class=\"form-group\">\n                            <div class=\"col-sm-10\">\n                                <label>Date Dropped</label>\n                                <date-picker value.two-way=\"people.selectedInstitution.dropDate\"  controlid=\"dropDate\"></date-picker>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"row\">\n                    <div class=\"col-sm-12 col-lg-3\">\n                        <div class=\"form-group\"> \n                            <div class=\"col-sm-10\">\n                                <label class=\"left\">Status *</label>\n                                <select value.bind=\"people.selectedInstitution.institutionStatus\" id=\"editInstitutonStatusArray\" class=\"form-control\">\n                                    <option value=\"\">Select an option</option>\n                                    <option repeat.for=\"status of is4ua.institutonStatusArray\" value=\"${status.code}\">${status.description}</option>\n                                </select>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n\n                <div class=\"row topMargin\">\n                    <div class=\"col-lg-12\">\n                        <div class=\"row\">\n                            <div class=\"panel panel-default\">\n                                <div class=\"panel-body\">\n                                    <div class=\"col-lg-2\">\n                                        <div id=\"instFormListGroup\" class=\"list-group\">\n                                            <a class=\"${ $first ? 'active' : ''} list-group-item\" repeat.for=\"tab of tabs\" href=\"\" class=\"list-group-item\" click.delegate=\"changeTab($event, $index)\">\n                                                <h4 id=\"${tab.id}\" class=\"list-group-item-heading\">${tab.title}</h4>\n                                            </a>\n                                        </div>\n                                    </div>\n\n                                    <div class=\"col-lg-10\">\n                                        <div class=\"tab-content\">\n                                            <div repeat.for=\"tab of tabs\" id=\"${tab.id + 'Tab'}\" class=\"${ $first ? 'tab-pane fade in active' : 'tab-pane fade' }\">\n                                                <compose view=\"${tabPath + tab.id + '.html'}\"></compose>\n                                            </div>\n                                        </div>\n                                    </div>\n\n                                </div>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </form>\n        </div>\n    </div>\n    </template>"; });
define('text!modules/admin/customers/components/institutionsTable.html', ['module'], function(module) { module.exports = "<template>\n    <div class=\"col-lg-12 col-sm-12\">\n        <div class='row'>\n            <div class='col-lg-10 col-lg-offset-1 bottomMargin'>\n                <div id=\"no-more-tables\">\n                    <table class=\"table table-striped table-hover cf\">\n                        <thead class=\"cf\">\n                            <tr colspan='6'>\n                                 <compose view=\"../../../../resources/elements/table-navigation-bar.html\"></compose>\n                                 </tr>\n                            <tr>\n                                <td colspan='6'>\n                                    <span click.delegate=\"refresh()\" class=\"smallMarginRight\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"Refresh\"><i class=\"fa fa-refresh\" aria-hidden=\"true\"></i></span>\n                                    <span click.delegate=\"new()\" bootstrap-tooltip data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"\" data-original-title=\"New\"><i class=\"fa fa-plus\" aria-hidden=\"true\"></i></span>\n                                    <span class=\"pull-right\" id=\"spinner\" innerhtml.bind=\"spinnerHTML\"></span>\n                                </td>\n                            </tr>\n                            <tr>\n                                <th style=\"width:20rem;\">Name <span click.trigger=\"dataTable.sortArray('name')\"><i class=\"fa fa-sort\"></i></span></th>\n                                <th style=\"width:30rem;\">Institution Type</th>\n                                <th style=\"width:15rem;\">Member Type</th>\n                                <th style=\"width:20rem;\">Member Since</th>\n                                <th>Highest Degree</th>\n                                <th>Status</th>\n                            </tr>\n                        </thead>\n                        <tbody>\n                            <tr>\n                                <th>\n                                    <input input.delegate=\"dataTable.filterList($event)\" id=\"name\" type=\"text\" placeholder=\"Filter Name\" class=\"form-control\">\n                                </th>\n                                <th>\n                                    <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"institutionType\" compare=\"status\">\n                                    <option value=\"\"></option>\n                                    <option repeat.for=\"institution of is4ua.institutionTypes\" value=\"${institution.code}\">${institution.description}</option>\n                                </select>\n                                </th>\n                                <th>\n                                    <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"memberType\" compare=\"status\">\n                                    <option value=\"\"></option>\n                                    <option repeat.for=\"institution of is4ua.memberTypes\" value=\"${institution.code}\">${institution.description}</option>\n                                </select>\n                                </th>\n                                <th></th>\n                                <th>\n                                    <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"highestDegree\" compare=\"status\">\n                                    <option value=\"\"></option>\n                                    <option repeat.for=\"institution of is4ua.highestDegrees\" value=\"${institution.code}\">${institution.description}</option>\n                                </select>\n                                </th>\n                                <th>\n                                    <select change.delegate=\"dataTable.filterList($event)\" class=\"form-control \" id=\"institutionStatus\">\n                                    <option value=\"\"></option>\n                                    <option repeat.for='status of is4ua.institutonStatusArray' value='${status.code}'>${status.description}</option>\n                                </select>\n                                </th>\n                            </tr>\n                            <tr click.trigger=\"edit($index, $event)\" repeat.for=\"inst of dataTable.displayArray\">\n                                <td data-title=\"Name\">${inst.name}</td>\n                                <td data-title=\"Type\">${inst.institutionType | lookupDescription:is4ua.institutionTypes}</td>\n                                <td data-tile=\"Phone\">${inst.memberType | lookupDescription:is4ua.memberTypes}</td>\n                                <td data-title=\"Email\">${inst.joinDate | dateFormat:config.DATE_FORMAT_TABLE:true}</td>\n                                <td data-title=\"Role\">${inst.highestDegree | lookupDescription:is4ua.highestDegrees}</td>\n                                <td data-title=\"Status\">${inst.institutionStatus | lookupDescription:is4ua.institutonStatusArray}</td>\n                            </tr>\n                        </tbody>\n                    </table>\n                </div>\n            </div>\n        </div>\n    </div>\n</template>"; });
